  // Write your code here

  create(data) {
    console.log(" [Scene Transition] Entering TownScene");
    this.editorCreate();

    // Play Natural Park background music
    this.naturalParkMusic = this.sound.add("naturalParkMusic", {
      loop: true,
      volume: 0.2,
    });
    this.naturalParkMusic.play();

    // Create player sprite (position from data when returning from ProjectScene, else default)
    const tileSize = 32;
    const returnTileX = data?.returnTileX;
    const returnTileY = data?.returnTileY;
    const startTileX = returnTileX != null ? returnTileX : 44;
    const startTileY = returnTileY != null ? returnTileY : 38;
    this.player = this.add.sprite(
      startTileX * tileSize + tileSize / 2,
      startTileY * tileSize + tileSize, // Position at bottom of tile
      "trainer",
      0,
    );
    this.player.setDepth(get_depth_for_layer("player"));

    // Set sprite origin to bottom-center (0.5, 1.0) - standard for top-down RPGs
    // This aligns the character's feet with the tile
    // this.player.setOrigin(0.5, 1.0);

    // Player movement state
    this.playerMoving = false;
    this.playerLastFacing = "walk-down"; // idle frame = first frame of this direction
    this.tileSize = 32;

    // Set up camera to follow player (no roundPixels on camera to avoid flicker while moving)
    this.cameras.main.setZoom(1.4);
    this.cameras.main.startFollow(this.player);

    // Create animations  trainer sprite: row 0 = down, row 1 = left, row 2 = right, row 3 = up (4 frames each)
    this.anims.create({
      key: "walk-down",
      frames: this.anims.generateFrameNumbers("trainer", { start: 0, end: 3 }),
      frameRate: 10,
      repeat: -1,
    });

    this.anims.create({
      key: "walk-right",
      frames: this.anims.generateFrameNumbers("trainer", { start: 8, end: 11 }),
      frameRate: 10,
      repeat: -1,
    });

    this.anims.create({
      key: "walk-left",
      frames: this.anims.generateFrameNumbers("trainer", { start: 4, end: 7 }),
      frameRate: 10,
      repeat: -1,
    });

    this.anims.create({
      key: "walk-up",
      frames: this.anims.generateFrameNumbers("trainer", { start: 12, end: 15 }),
      frameRate: 10,
      repeat: -1,
    });

    // Exclamation markers over every project door (white "!" on black 50% bg)
    this.addProjectDoorMarkers();

    // Fade in from black when returning from ProjectScene
    if (returnTileX != null || returnTileY != null) {
      this.cameras.main.setBackgroundColor("#000000");
      this.cameras.main.fadeIn(400);
    }
  }

  /** Add a white "!" with black 50% opacity background above each project tile (door). */
  addProjectDoorMarkers() {
    const tileSize = this.tileSize ?? 32;
    const markerWidth = 48;
    const markerHeight = 64;
    const fontSize = 58;

    const createMarkerAt = (worldX, worldY) => {
      const container = this.add.container(worldX, worldY - tileSize * 2);
      container.setDepth(Z_DEPTH.IN_FRONT + 1);

      const bg = this.add.graphics();
      bg.fillStyle(0x000000, 0.5);
      bg.fillRoundedRect(-markerWidth / 2, -markerHeight / 2, markerWidth, markerHeight, 3);
      container.add(bg);

      const label = this.add.text(0, 0, "!", {
        fontSize: `${fontSize}px`,
        color: "#cef290",
        fontFamily: "sans-serif",
        fontStyle: "bold",
      });
      label.setOrigin(0.5, 0.5);
      container.add(label);
    };

    const tilemap = this.editabletilemap;
    if (!tilemap) return;

    for (const layerName of PROJECT_TILE_LAYER_NAMES) {
      tilemap.forEachTile(
        (tile) => {
          if (tile.index === -1) return;
          const worldX = tile.pixelX + tileSize / 2;
          const worldY = tile.pixelY;
          createMarkerAt(worldX, worldY);
        },
        this,
        0,
        0,
        undefined,
        undefined,
        {},
        layerName
      );
    }
  }

  update() {
    // Only process movement if player is not currently moving
    if (this.playerMoving) {
      return;
    }

    const cursors = this.input.keyboard.createCursorKeys();
    const wasd = this.input.keyboard.addKeys("W,S,A,D");

    // Check for input - prioritize vertical movement, then horizontal
    let direction = null;
    let animationKey = null;

    // Check vertical movement first
    if (cursors.up.isDown || wasd.W.isDown) {
      direction = "up";
      animationKey = "walk-up";
    } else if (cursors.down.isDown || wasd.S.isDown) {
      direction = "down";
      animationKey = "walk-down";
    }
    // Check horizontal movement only if no vertical input
    else if (cursors.left.isDown || wasd.A.isDown) {
      direction = "left";
      animationKey = "walk-left";
    } else if (cursors.right.isDown || wasd.D.isDown) {
      direction = "right";
      animationKey = "walk-right";
    }

    // Move one tile if direction is pressed
    if (direction) {
      this.movePlayerOneTile(direction, animationKey);
    } else {
      // Idle: show first frame of last facing direction (no default look at camera)
      const idleFrames = { "walk-down": 0, "walk-left": 4, "walk-right": 8, "walk-up": 12 };
      this.player.setFrame(idleFrames[this.playerLastFacing] ?? 0);
      this.player.anims.stop();
    }
  }

  movePlayerOneTile(direction, animationKey) {
    if (this.playerMoving) return;

    // Calculate target position (one tile in the direction)
    let targetX = this.player.x;
    let targetY = this.player.y;

    switch (direction) {
      case "up":
        targetY -= this.tileSize;
        break;
      case "down":
        targetY += this.tileSize;
        break;
      case "left":
        targetX -= this.tileSize;
        break;
      case "right":
        targetX += this.tileSize;
        break;
      default:
        break;
    }

    // Check for collision at target position
    if (this.hasCollision(targetX, targetY)) {
      // Collision detected, prevent movement
      return;
    }

    this.playerMoving = true;
    this.playerLastFacing = animationKey;
    this.player.play(animationKey, true);

    // Move player one tile using tween  duration matches one full walk cycle (4 frames @ 10fps = 400ms)
    this.tweens.add({
      targets: this.player,
      x: targetX,
      y: targetY,
      duration: 400,
      ease: "Linear",
      onComplete: () => {
        this.playerMoving = false;
        this.player.anims.stop();
        if (this.checkProjectTileAndLaunch) this.checkProjectTileAndLaunch();
      },
    });
  }

  /**
   * Wall collision: uses collision_layer. Out of bounds = wall. Tile index 0/empty = walkable, non-empty = wall.
   */
  hasCollision(x, y) {
    if (!this.collisionLayer) {
      return false;
    }

    const tileX = Math.floor(x / this.tileSize);
    const tileY = Math.floor(y / this.tileSize);

    // Wall: block movement outside map bounds
    const width = this.collisionLayer.width;
    const height = this.collisionLayer.height;
    if (tileX < 0 || tileX >= width || tileY < 0 || tileY >= height) {
      return true;
    }

    const tile = this.collisionLayer.getTileAt(tileX, tileY);

    // No tile (null) or empty (index -1) = walkable
    if (tile === null || tile.index === -1) {
      return false;
    }

    // Non-empty tile = wall
    return true;
  }

